import React, 
{useState} from 'react'
import Content from './Content'

export default function Latest() {
  const [datann,setdata]=useState();
  const call= async()=>{
    let data= await fetch('http://localhost:4000/api/posts');
    let datan= await data.json();
    setdata(datan.data);
    console.log(datan.data);
};

useEffect(()=>{
    call();
},[])
  return (
    <Content></Content>
  )
}
